metadata.content:
Gemini Model
Configuration
The
```
gemini
```
function accepts a model name string or a configuration object:
Copy Ask AI
```
const agent = createAgent ({
model: gemini ({
model: "gemini-pro" ,
apiKey: process . env . GOOGLE_API_KEY ,
baseUrl: "https://generativelanguage.googleapis.com/v1/" ,
defaultParameters: {
generationConfig: {
temperature: 1.5 ,
},
},
}),
});
```
